import React from 'react';

const ResCard = ({result}) => {

    console.log(result)
    return (
        <section className="bg-brown">
            <div className="container">
                {result.result.map(it => {
                    return (
                            <div>{it.question}</div>
                    )

                })}
            </div>
        </section>
    );
};

export default ResCard;
